import React from 'react';
import Radio from './Radio';
import S from './style';

const RadioWithLabel = ({ checked, onClick, size = 'M', label }) => {
    return (
        <S.LabelWrapper size={size} onClick={onClick}>
            <Radio checked={checked} size={size} />
            <span>{label}</span>
        </S.LabelWrapper>
    );
};

export default RadioWithLabel;
